import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div className="home-container">
      <h1>Welcome to the Subscription System</h1>
      <p>Browse our plans and subscribe to access premium features.</p>
      <div className="home-actions">
        <Link to="/plans" className="action-link">View Plans</Link>
        <Link to="/login" className="action-link">Login</Link>
        <Link to="/register" className="action-link">Register</Link>
      </div>
    </div>
  );
};

export default Home;
